import React from "react";

const handleProductChange = (event) => {
  setProducts(event.target.value);
};

const InputForm = () => {
  return (
    <div>
      <br></br>
      <div className="row">
        <label htmlFor="product-input" placeholder="Product"></label>
        <input
          id="product-input"
          // onChange={handleProductChange}
          type="text"
          label="product"
        ></input>
        <label htmlFor="price-input"></label>
        <input
          id="price-input"
          // onChange={handleProductChange}
          type="text"
          label="price"
        ></input>
        <label htmlFor="description-input"></label>
        <input
          id="description-input"
          // onChange={handleProductChange}
          type="text"
          label="description"
        ></input>
        <button type="submit">Submit</button>
      </div>
      <br></br>
    </div>
  );
};

export default InputForm;
